  <style>
  .text {
  text: flex;
  justify-content: center;
  align-items: center;

  border-radius: 100px;
  height: 30px;
  width:30px;
  font-family: sans-serif;
}
​
.label-text{
  background-color: white;
  
}


  </style>
  <script>
export default {
  data() {
    return {
      form: {
        text: '',
      },
    }
  },
  mounted(){
    this.placeText()
 },

  methods: {
    placeText(){
      const endPath = document.getElementById('END');

      var countries = document.getElementsByClassName('country')

      for(var i = 0; i < countries.length; i++)
      {


        const bgPath = document.getElementById(countries[i].id);
      let bbox = bgPath.getBBox();
      let x = bbox.x + bbox.width / 2;
      let y = bbox.y + bbox.height / 2;
         // Create a <text> element
      let textElem = document.createElementNS(bgPath.namespaceURI, "text");
      textElem.setAttribute("x", x);
      textElem.setAttribute("y", y);

      // Centre text horizontally at x,y
      textElem.setAttribute("text-anchor", "middle");

      textElem.setAttribute("fill", "#ffcc00");
      textElem.setAttribute("stroke", "orange");
      textElem.setAttribute("stroke-width", "1");
      // Give it a class that will determine the text size, colour, etc
      textElem.classList.add("label-text");
      textElem.classList.add(countries[i].id.toLowerCase());
      // Set the text

      textElem.textContent = bgPath.getAttribute("name");


      // Add this text element directly after the label background path

      endPath.after(textElem);
      }
    },


     changeText(){
      var textValue = document.getElementById("textId").value;

      var words = document.getElementsByClassName('label-text')
      var countries = document.getElementsByClassName('country')
      for(var i = 0; i < countries.length; i++)
      {
        let countryCode = countries[i].id;
        let translatedText =  this.submitForm(textValue,countryCode,words,i);

        //words[i].textContent = translatedText;

      }

    },

     submitForm(textValue,countryCode) {
      
      const response = $fetch('https://translation.googleapis.com/language/translate/v2?key='+useRuntimeConfig().TRANSLATE_API_KEY, {
        method: 'POST',
        body: {  "q": textValue, "target": countryCode}
      } 
      );
      response.then(
        (result) => { 
          var word = document.getElementsByClassName(countryCode.toLowerCase())
          word[0].innerHTML = result.data.translations[0].translatedText;

        },
        (error) => { 
          console.log(error);
        }
      );
      
    } 
  }
} 
  </script>